export default function LandingPage() {
    return (
        <>
            <h3>In Theaters</h3>
            <MovieList Movies={movies.inTheaters}></MovieList>
            <h3>Upcoming Release</h3>
            <MovieList Movies={movies.upcomingRelease}></MovieList>
        </>
    )
}
